import React from "react";
import { useNavigate } from "react-router-dom";


const ProjectsPage = () => {
  const navigate = useNavigate();

  const projects = [
    {
      id: 1,
      title: "VASAVI BRINDHAVANAM III",
      description:
        "Step into the enchanting world of Vasavi Brindavanam-iii through this captivating walk-through video, where nature's serenity and architectural beauty merge seamlessly. As you meander through the meticulously landscaped gardens and pathways, a sense of tranquility envelops you. The grand entrance, adorned with intricate details, sets the tone for the stunning surroundings. The wide, well-maintained roads guide you to discover the luxurious amenities, including a lavish clubhouse, fitness center, swimming pool, and recreational spaces. Vasavi Brindavanam-iii is a true haven, where every step unveils a paradise of beauty and elegance.",
      image: <iframe width="560" height="315" src="https://www.youtube.com/embed/0gzqbjvd-uk?si=WnLklsKH7oAvjX_Q&amp;controls=0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>,

    },
    {
      id: 2,
      title: "Task Management System",
      description:
        "A comprehensive task management application with real-time updates, team collaboration features, and progress tracking capabilities.",
      image: "https://images.unsplash.com/photo-1454165804606-c3d57bc86b40",

    },
    {
      id: 3,
      title: "Social Media Dashboard",
      description:
        "An analytics dashboard for social media management, providing insights and metrics visualization for multiple platforms.",
      image: "https://images.unsplash.com/photo-1460925895917-afdab827c52f",

    },
    {
      id: 4,
      title: "Weather Forecast App",
      description:
        "A weather application that provides real-time forecasts, interactive maps, and detailed weather information for locations worldwide.",
      image: "https://images.unsplash.com/photo-1504608524841-42fe6f032b4b",

    },
    {
      id: 5,
      title: "Portfolio Generator",
      description:
        "A tool that helps developers create and customize their professional portfolios with various templates and styling options.",
      image: "https://images.unsplash.com/photo-1461749280684-dccba630e2f6",

    },
    {
      id: 6,
      title: "Recipe Finder",
      description:
        "A recipe discovery platform with filtering capabilities, nutritional information, and meal planning features.",
      image: "https://images.unsplash.com/photo-1466637574441-749b8f19452f",

    },
  ];

  const ProjectItem = ({ project }) => (
    <div className="bg-white rounded-lg shadow-lg overflow-hidden transition-transform duration-300 hover:scale-105 mb-8">
      <div className="md:flex">
        <div className="md:w-1/3">
          <div
            src={project.image}
            alt={project.title}
            className="h-64 w-full object-cover"
            onError={(e) => {
              e.target.src =
                "https://via.placeholder.com/300?text=Image+Unavailable";
            }}
          />
        </div>
        <div className="md:w-2/3 p-6">
          <h2 className="text-2xl font-bold text-gray-800 mb-4">
            {project.title}
          </h2>
          <p className="text-gray-600 mb-4">{project.description}</p>

        </div>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-100 py-12">
      <div className="mx-auto px-8 sm:px-16 lg:px-24 max-w-7xl">
        <button
          onClick={() => navigate("/")}
          className="mb-8 bg-primary-orange text-white px-4 py-2 rounded-lg hover:bg-orange-600"
        >
          Back to Home
        </button>
        <h1 className="text-4xl font-cairo font-bold text-gray-800 mb-8">Our Projects</h1>
        <div className="space-y-8">
          {projects.map((project) => (
            <ProjectItem key={project.id} project={project} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default ProjectsPage;
